import React, { useEffect } from 'react';

const Step13 = () => {
  useEffect(() => {
    // Perform any final operations like redirecting
    setTimeout(() => {
      window.location.href = 'https://app.huberway.com';
    }, 5000); // Redirect after 5 seconds
  }, []);

  return (
    <>
      <div className="row">
        <div className="col-md-12 head-register">
          <h1>Thank you! Welcome to Huberway</h1>
          <p>Your account is ready. Wait a few seconds, and the page will redirect you automatically...</p>
          <img
            src="https://app.huberway.com/account/assets/img/engineering_for_dribbble.gif"
            alt="Welcome Animation"
            style={{ height: '40%' }}
          />
        </div>
      </div>
    </>
  );
};

export default Step13;
